import React from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, names}) {


let katName = names.map((name, index) => 
	<Text>
		{name}	
	</Text>
	)
	return (
		<View>
		{
			names.map((name, index) => (
				<View>
					<Image
			              	source={{
			                width: 200,
			                height: 200,
			                uri: preview
			            }}
			              />
			         {name}
				</View>
				))
		}
		</View>

	)
}

export default KatsItem;
